import React, { useState } from 'react';
import './MyWork.css';
import { FaCog, FaExpand, FaEllipsisH } from 'react-icons/fa';

const MyWork = () => {
  const [showSettings, setShowSettings] = useState(false); // More settings açılır menüsü için state

  const toggleSettings = () => {
    setShowSettings(!showSettings);
  };

  return (
    <div className="my-work-container">
      <div className="my-work-header">
        <h2>My Work</h2>
        <div className="my-work-icons">
          <button className="icon-btn" title="Settings">
            <FaCog />
          </button>
          <button className="icon-btn" title="Full screen">
            <FaExpand />
          </button>
          <button className="icon-btn" onClick={toggleSettings} title="More settings">
            <FaEllipsisH />
          </button>
        </div>
      </div>

      {showSettings && (
        <div className="more-settings-menu">
          <div className="settings-item">
            <label>Subtask parent names</label>
            <input type="checkbox" defaultChecked />
          </div>
          <div className="settings-item">
            <label>Task locations</label>
            <input type="checkbox" defaultChecked />
          </div>
          <div className="settings-item">
            <label>Include tasks that only have start dates</label>
            <input type="checkbox" defaultChecked />
          </div>
        </div>
      )}
    </div>
  );
};

export default MyWork;
